import React, { Component } from 'react'

export default class FoodContent extends Component {
  render() {
    return (
      <div className="nutrition-content">
        <div className="head">
          <h3>Nutrient</h3>
          <h3>Unit</h3>
          <h3>Weight</h3>
        </div>
        <div className="side">
          <h3>Energy</h3>
          <h3>Protein</h3>
          <h3>Carbohydrate</h3>
          <h3>Fat</h3>
        </div>

      </div>
    )
  }
}
